  ["echoed"] = "<html><body><h1>echoed</h1><p>imp. & p. p. of Echo</p><p>v. 重复, 随声附和( echo的过去式和过去分词 ); 类似; 发射（声音等）; 发出回声</p></body></html>",
  ["echoer"] = "<html><body><h1>echoer</h1><p>n. One who, or that which, echoes.</p><p>n. echo的变形</p></body></html>",
  ["echoers"] = "<html><body><h1>echoers</h1><p>echoer<p></p>n.<p></p>echo的变形<p></p>echo<p></p>['ekəu]<p></p>n.<p></p>反响，回响；回声，回音<p></p>(言语、作风、思想等的)重复；仿效，模仿；附和<p></p>重复者；仿效者；附和者，应声虫<p></p>共鸣<p></p>[有时用复数]反响；后果<p></p>【桥牌】回声信号，(向搭档报信息的)应答性出牌(在某花色仅有两张牌时出牌先大后小，鼓励搭档续攻此花色)[亦作high-low或come-on]<p></p>【无线电】回波；反射波，反射信号<p></p>【音乐】<p></p>回声，回音，反响<p></p>(风琴中的)回声音栓<p></p>【韵律学】<p></p>(韵文中下一行句末与上一行句末的)同韵脚<p></p>下一行重复上一行最后诸音节的)韵律<p></p>vi.<p></p>发出回声，产生回响，反响，起反响，回响；回荡；(声音)被传回；起共鸣：<p></p>The hall echoed with cheers.<p></p>欢呼声响彻大厅。<p></p>被重复，重复别人的话语(或思想、感情、行动等)；仿效别人的风格(或谈吐等)，被仿效：<p></p>Shouts echoed through the street.<p></p>喊叫声在街上回荡。<p></p>【桥牌】发出回声信号<p></p>vt.<p></p>发射(声音等)，发出…的回声：<p></p>The big ball echoes the faintest sounds.<p></p>最微小的声音在这大厅里也会产生回响。<p></p>重复(或模仿)(别人的)话(或思想感情等)<p></p>重复(或模仿)(别人的话或思想感情等)；(随声)附和：<p></p>The pupil echoed his teacher's words.<p></p>小学生重复老师的话。<p></p>They echoed every word of their leader.<p></p>他们随声附和他们领导人的每句话。<p></p>类似；与…相似，像：<p></p>The student and his teacher echoed each other in writing style.<p></p>学生和他老师在创造风格方面彼此相似。<p></p>【计算机】使回标；向…提供视觉反馈<p></p>短语:<p></p>applaud(或cheer) … to the echo<p></p>为…大声叫好(或喝彩)，掌声雷动<p></p>find an echo in someone's heart<p></p>在某人心中引起共鸣<p></p>变形：<p></p>n.<p></p>echoes<p></p>vi.<p></p>echoed<p></p>. echoing</p></body></html>",
