  ["emblazers"] = "<html><body><h1>emblazers</h1><p>emblazer<p></p>n.<p></p>emblaze1的变形<p></p>emblaze2的变形<p></p>emblaze1<p></p>[im'bleiz]<p></p>vt.<p></p>点(灯)；(用火)照亮，照明，照耀；使发亮，使发光<p></p>点(火)，点燃<p></p>变形：<p></p>vt.<p></p>emblazed<p></p>. emblazing<p></p>emblaze2<p></p>[im'bleiz]<p></p>vt.<p></p>[古语]用纹章装饰(盾等)( ＝ emblazon)<p></p>对…作豪华的装饰，用鲜艳的色彩装饰，盛饰<p></p>变形：<p></p>vt.<p></p>emblazed<p></p>. emblazing</p></body></html>",
