  ["emblazoners"] = "<html><body><h1>emblazoners</h1><p>emblazoner<p></p>n.<p></p>emblazon的变形<p></p>emblazon<p></p>[im'bleizən]<p></p>vt.<p></p>以纹章装饰(盾等)，饰…以纹章，把纹章刻在…上(with):<p></p>The king's shield was emblazoned with his family coat of arms.<p></p>国王的盾牌装饰有他家族的盾徽。<p></p>(据纹章学惯例)描绘(纹章)，给(纹章)着色<p></p>用鲜艳色彩装饰(或画)；用鲜花等装饰，盛饰；炫示：<p></p>Posters were emblazoned on the walls of the department store.<p></p>百货商店的墙壁上贴满了五彩缤纷的广告画。<p></p>(企图引起公众注意而)宣扬，颂扬，赞颂；表彰:<p></p>The great leader's exploits were emblazoned in song and story.<p></p>伟大领袖的业绩被人们作诗谱曲加以吟颂。</p></body></html>",
