  ["encroachers"] = "<html><body><h1>encroachers</h1><p>encroacher<p></p>n.<p></p>encroach的变形<p></p>encroach<p></p>[in'krəutʃ]<p></p>vi.<p></p>(暗中或逐步)侵占，占用(别人的时间)(on 或 upon)：<p></p>She has no right to encroach on my time.<p></p>她没有权利占用我的时间。<p></p>(偷偷地或逐渐地)侵犯(别人的权利、财产、领土等)，侵害；蚕食(领地等)(on 或 upon)：<p></p>to encrocach on the right of the individual<p></p>侵犯个人的权利<p></p>to encroach on someone's territory<p></p>侵占某人的领土<p></p>侵蚀；超越确立(或正常、通常)的界限(on 或 upon)：<p></p>The desert continually encroaches on the fertile land.<p></p>沙漠在不断地侵蚀肥沃土地。<p></p>侵袭，侵入，闯入(on 或 upon):<p></p>to encroach on someone's private life<p></p>闯入某人的私生活<p></p>近义词:<p></p>trespass</p></body></html>",
