  ["ensurers"] = "<html><body><h1>ensurers</h1><p>ensurer<p></p>n.<p></p>ensure的变形<p></p>ensure<p></p>[in'ʃuə]<p></p>vt.<p></p>保证，担保，确保：<p></p>I cannot ensure his being on time.<p></p>我不能保证他会准时。<p></p>No one can ensure that he'll come.<p></p>没有人能保证他会来。<p></p>If you want to ensure that you catch the plane,take a taxi.<p></p>如果你想确保赶上航班，那就叫辆出租汽车。<p></p>保证获得；使(某人)获得，保证给予，赋予 (to，for)：<p></p>This letter will ensure you a hearing.<p></p>这封信准保你能获得申诉的机会。<p></p>The present contract cannot ensure you a job.<p></p>本合同不能保证你获得工作。<p></p>使肯定，使确实，确定：<p></p>measures to ensure the success of an undertaking<p></p>确保一项事业成功的措施<p></p>measures to ensure accuracy<p></p>保证准确的措施<p></p>使安全,保护 (against,from):<p></p>safety devices to ensure staff against accidents<p></p>保护全体雇员免出事故的安全设施<p></p>to ensure someone against (或from)danger<p></p>保护某人免受危险<p></p>[废语] 使订婚；与…订婚<p></p>[废语] 明确通知(某人)<p></p>[亦作 insure]<p></p>变形：<p></p>vt.<p></p>ensured<p></p>. ensuring</p></body></html>",
