  ["entanglers"] = "<html><body><h1>entanglers</h1><p>entangler<p></p>n.<p></p>entangle的变形<p></p>entangle<p></p>[in'tæŋɡl]<p></p>vt.<p></p>使纠缠；使陷入网中，使落入圈套，套住，缠住：<p></p>The bird entangled itself in the net.<p></p>小鸟陷入网中，被缠住了。<p></p>使陷入困境：<p></p>The country became entangled in a grave economic crisis.<p></p>该国陷入了严重的经济危机。<p></p>使混乱，弄乱，使杂乱；使错综复杂 ，使纠缠不清；使困惑；使迷惑：<p></p>to entangle a subject<p></p>把问题弄得复杂化<p></p>to be entangled by the charms and flattery of a bad woman<p></p>被一个坏女人的美色和甜言蜜语所迷惑<p></p>使陷入，使卷入；牵连，连累：<p></p>to be entangled by intrigue<p></p>陷入了阴谋圈套<p></p>They became entangled in dishonest business dealings.<p></p>他们陷入了不正当的商业交易之中。<p></p>(与坏人)交往，与…有牵连(with):<p></p>It looks as if he has been entangled with the bad woman.<p></p>看来他与那个坏女人有来往。<p></p>to get entangled with<p></p>an undesirable woman<p></p>同一个讨厌的女人纠缠不清<p></p>变形：<p></p>vt.<p></p>entangled<p></p>. entangling</p></body></html>",
