  ["enterers"] = "<html><body><h1>enterers</h1><p>enterer<p></p>n.<p></p>enter的变形<p></p>enter<p></p>['entə]<p></p>vi.<p></p>入，进，进入，进去，进来：<p></p>Knock before you enter.<p></p>进来前先敲门。<p></p>入学；参加比赛；报名参加：<p></p>Some contestants enter as late as a day before the race.<p></p>有些参赛选手直到赛跑前一天才报名参赛。<p></p>穿入，刺入：<p></p>The sword entered deep.<p></p>刀剑深深地刺入。<p></p>正式开始；着手处理；开始考虑 (on，upon):<p></p>We have entered upon a new phase in history.<p></p>我们已开始了历史的新纪元。<p></p>【戏剧】[舞台指示用语]上，上场，登场[用第三人称单数或复数]：<p></p>Enter Othello.(或 Othello enters.)<p></p>奥塞罗上。<p></p>vt.<p></p>进，入，进入：<p></p>The thought never entered my mind.<p></p>我从未有过这种想法。<p></p>Jack just entered the building.<p></p>杰克刚进大楼。<p></p>射入；穿入，贯穿；刺入：<p></p>The bullet entered the flesh.<p></p>子弹射进肉里。<p></p>使入学；使参赛，使加入，使参加；使进入：<p></p>to enter a horse in a race<p></p>使一匹马参加比赛<p></p>插入；放入：<p></p>to enter a wedge under a door<p></p>在门下插入一个楔子<p></p>to enter a key in the door<p></p>把钥匙插入门锁孔里<p></p>成为(政党、学校、俱乐部等)的一员；参加，加入；使(人等)被接纳(或被录用)：<p></p>to enter a club<p></p>加入俱乐部<p></p>to enter a party<p></p>入党<p></p>to enter a college<p></p>上大学<p></p>开始；开始从事；着手进行；开始进入：<p></p>Harry entered the medical profession.<p></p>哈里开始行医了。<p></p>to enter a career<p></p>开始一种生涯<p></p>分担；分享；理解；体谅：<p></p>In order to appreciate the novel,one must be able to enter the spirit of the work.<p></p>要想欣赏这部小说，你必须领悟这部作品的精神。<p></p>(在记录、名单、日记等中)写下；记录，记载；登录，登记；注册；把…记入(账簿等)；把…编入；把…列入条目(或项目、词条等)；刊印：<p></p>to enter a new word in a dictionary<p></p>把一个新词编入词典<p></p>提出，提交，正式登记；(书面或正式)提出(抗议等)：<p></p>to enter a bid for a contract<p></p>给合同投标<p></p>to enter an objection to a proposed action<p></p>对一项议案提出异议<p></p>to enter<p></p>a protest<p></p>(正式)提出抗议<p></p>把(船只或货物)申报海关，向海关申报(船只或货物)<p></p>【法律】<p></p>正式记载(某事实)，正式(或书面)提出(证据、申诉等)；登记；递呈：<p></p>to enter an action against someone<p></p>正式对某人提出诉讼<p></p>进入并侵占(土地、房屋等)<p></p>[美国英语] 对(某块公地)提出所有权要求<p></p>【计算机】加入，送进，把(文件、程序、数据等)输入计算机系统：<p></p>Enter your new document into the word-processing system.<p></p>把你的新文件输入文字处理系统。<p></p>驯(马等)；训练(犬等)<p></p>[