  ["extemporizers"] = "<html><body><h1>extemporizers</h1><p>extemporizer<p></p>n.<p></p>extemporize的变形<p></p>extemporize<p></p>[ik'stempəraiz]<p></p>vi.<p></p>即席发言，即席演说：<p></p>The speaker can extemporize on any of a number of subjects.<p></p>该演讲人对若干题目中的任一个都能即席发言。<p></p>【音乐】即兴演唱(或演奏、舞蹈)：<p></p>Certain performers can extemporize.<p></p>有些演员能即兴表演。<p></p>临时(或当场)作成，临时凑合：<p></p>to extemporize without a plan or any preparation<p></p>无计划或无准备地临时作成<p></p>vt.<p></p>即席发表(演说等)，即席发(言)：<p></p>The president extemporized a speech after the working dinner.<p></p>总裁即席发表了一篇工作餐后演说。<p></p>【音乐】即兴演唱(或演奏、演出、谱曲、创作)：<p></p>to extemporize dialogue<p></p>即兴地随口拼凑台词<p></p>临时(或当场)作成：<p></p>to extemporize a bed for the night<p></p>临时铺张床过夜<p></p>变形：<p></p>vi.<p></p>extemporized<p></p>. extemporizing</p></body></html>",
  ["extemporizes"] = "<html><body><h1>extemporizes</h1><p>v manage in a makeshift way; do with whatever is at hand<p></p>v perform without preparation</p><p>v. 即兴创作, 即席演奏( extemporize的第三人称单数 )</p></body></html>",
